script: |
  super -f text -I q12091.spq | sort > q12091.out

inputs:
  - name: q12091.spq
    data: |
      SELECT DISTINCT - + col2 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + 58 + + - col0 NOT BETWEEN - 26 AND NULL OR NOT - - col2 IS NULL;
  - name: tab1

outputs:
  - name: q12091.out
    data: |
      -59
      -68
      -96
